import Landing from './Landingpage/Landing';
import './App.css';
import { BrowserRouter as Router} from 'react-router-dom';
import Contact from './Contact/Contact';
import Projects from './Projects/Projects';

function App() {
  return (
    <div className="App">
      <Router>
        <Landing/>
      </Router>
      <Projects/>
      <Contact/>
    </div>
  );
}

export default App;
